int(video_test_xpm)(xpm_map_t xpm, uint16_t x, uint16_t y) {
  vg_init(0x115);
  vg_draw_rectangle(0,0,800,150,0x966F33);
  get_xpm(grass,  0,  150);
  get_xpm(snaketail,  360,  300);
  get_xpm(snakebody,  380,  300);
  get_xpm(snakehead,  400,  300);
  uint8_t bit_no=0;
  int ipc_status,r;
  message msg;
  kbd_subscribe_int(&bit_no);
  int irq_set = BIT(bit_no);
  while(last!=ESC) {
    tickdelay(micros_to_ticks(DELAY_US));
    if( (r = driver_receive(ANY, &msg, &ipc_status)) != 0 ) {
      printf("driver_receive failed with: %d", r);
      continue;
    }
    if (is_ipc_notify(ipc_status)) {
      switch (_ENDPOINT_P(msg.m_source)) {
        case HARDWARE:
          if (msg.m_notify.interrupts & irq_set) {
            kbc_ih();
          }
          break;
        default:
          break;
      }
    }
    else {}
  }
  kbd_unsubscribe_int();
  vg_exit();
  return 1;
}

int(video_test_move)(xpm_map_t xpm, uint16_t xi, uint16_t yi, uint16_t xf, uint16_t yf,
                     int16_t speed, uint8_t fr_rate) {
  
  vg_init(0x115);
  vg_draw_rectangle(0,0,800,150,0x966F33);
  
  int xtail = 360;
  int ytail = 300;
  int xbody = 380;
  int ybody = 300;
  int xhead = 400;
  int yhead = 300;
  uint8_t bit_no=0;
  int ipc_status,r;
  int irq_tmr;
  int irq_kbd;
  //int tmp;
 //uint16_t x= xi, y=yi;
  message msg;
  if(kbd_subscribe_int(&bit_no) != 0)
      return 1; 
  irq_kbd = BIT(bit_no);
  
  if(timer_subscribe_int(&bit_no) != 0)
    return 1;
  irq_tmr = BIT(bit_no);
  while(last!=ESC) {
    if( (r = driver_receive(ANY, &msg, &ipc_status)) != 0 ) {
      printf("driver_receive failed with: %d", r);
      continue;
    }
    if (is_ipc_notify(ipc_status)) {
      switch (_ENDPOINT_P(msg.m_source)) {
        case HARDWARE:
          if (msg.m_notify.interrupts & irq_kbd) {
            kbc_ih();
          }
          if(msg.m_notify.interrupts & irq_tmr){
            timer_int_handler();
            if(speed >= 0){
              if((COUNTER % 1)==0){
                    xtail+=5;
                    xbody+=5;
                    xhead+=5;
                    get_xpm(snaketail,  xtail,  ytail);
                    get_xpm(snakebody,  xbody,  ybody);
                    get_xpm(snakehead,  xhead,  yhead);
                    swap_buffer();
                    get_xpm(grass,0,150);
                    delete_xpm(snaketail,  xtail-5,  ytail);
                    delete_xpm(snakebody,  xbody-5,  ybody);
                    delete_xpm(snakehead,  xhead-5,  yhead);
                }
              }
              else{
                //tmp = video_move_onePixeldisplacement( ubuntu_xpm,&x,&y,xi,yi,xf,yf,speed,fr_rate;
              }
              /*if(tmp==1)return 1; 
              else if(tmp==2) break; */
          }
          break;
        default:
          break;
      }
    }
    else {}
  }
  timer_unsubscribe_int();
  kbd_unsubscribe_int();
  vg_exit();
  return 1;
}
